INSERT INTO `banners` (`id`, `titulo`, `imagen`, `texto`, `seccion`, `updated_at`, `created_at`) VALUES
	(1, 'Empresa', 'fotos/npVnzmXlyOEQaTTjkryAmsr8uS2y2HAZobp07Zh4.png', '<p data-v-70ff3320="" class="text" style="color: rgb(255, 255, 255); background-color: rgb(47, 63, 120);"><span data-v-70ff3320="" class="kotex">Kotex SRL</span>,&nbsp;fábrica de cintas elásticas y rígidas de crochet,&nbsp;es una empresa familiar con casi 30 años en el rubro textil.</p><p data-v-70ff3320="" class="text" style="margin-top: 50px; color: rgb(255, 255, 255); background-color: rgb(47, 63, 120);">Por la calidad&nbsp;de nuestros productos y especial enfoque en la “atención personalizada” ocupamos un lugar de preferencia entre las empresas confeccionistas de reconocidas marcas.</p>', 'home', '2024-04-26 18:46:36', NULL),
	(2, '¿Quienes somos?', 'fotos/nO0hm4NTAv3wmvoigR8Ok32R3nkwYO6axS8vcPIL.png', '<p class="text" data-v-639cb22c=""><span class="kotex" data-v-639cb22c="">Kotex SRL</span>,&nbsp;fábrica de cintas elásticas y rígidas de crochet,&nbsp;es una empresa familiar con casi 30 años en el rubro textil.</p><p class="text" data-v-639cb22c="">Por la calidad&nbsp;de nuestros productos y especial enfoque en la “atención personalizada” ocupamos un lugar de preferencia entre las empresas confeccionistas de reconocidas marcas.</p><p class="text" data-v-639cb22c="">Es nuestro deseo es seguir creciendo día a día junto con nuestros clientes brindándoles soluciones eficientes y procurando mantener balanceados los parámetros de:&nbsp;Precio, Calidad y Servicio.</p>', 'nosotros', '2024-04-26 19:47:36', NULL);
